css:
.dialog.quick-query-connect select {
  height: 25px;
  color: #aaa;
  background-color: #212224;
  border-color: rgba(0, 0, 0, 0.5);
  font-size: 14px;
  line-height: 25px;
  padding: 0 0 0 5px;
  margin-bottom: 10px;
}
.dialog.quick-query-connect #quick-query-browse-file {
  width: 100%;
}
.dialog.quick-query-connect .qq-local-info {
  display: none;
}
.dialog.quick-query-connect .advance-toggle {
  border: none;
  background: none;
  padding: 0;
  position: absolute;
  right: 15px;
}
.dialog.quick-query-connect .qq-advanced-info {
  display: none;
}
